import React from 'react';
import { Box, Container, Grid } from '@mui/material';
import Navbar from './components/Navbar';
import AccountCard from './components/AccountCard';

function Home() {
    return(
        <Box>
            <Navbar/>
            <Container>
                <Grid container spacing={3}>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                    <AccountCard/>
                </Grid>     
            </Container>
        </Box>
    );
}

export default Home;
